import React from 'react'

const NavbarMenu = (props) => {
	return(
		<div className="collapse navbar-collapse" id="navbar-collapse-uarr">
      <ul className="nav navbar-nav navbar-right">
        <li><a href="#home" title="" className="active" onClick = {props.handleClick} >Dom≈Ø</a></li>
        <li><a href="/info" title="" > Informace</a></li>
        <li><a href="#kontakt" title="" className="link">Kontakt</a></li>          
      </ul>
    </div>
	)
}

export default NavbarMenu;
